import React from "react";

const Trailer = (props) => {
  let url = `https://www.youtube.com/embed/${props.trailer}`;
  return (
    <div style={{ width: 960, height: 1080 }}>
      <embed type="video/webm" src={url} />
      {console.log(url)}
    </div>
  );
};

export default Trailer;
